    <!-- Mapbox Integration -->
    <script>
    // Store references for proper Mapbox integration
    window._mapboxLayers = null;
    window._locateControlRef = null;

    // Wait for map to be ready, then add Mapbox layers
    document.addEventListener('DOMContentLoaded', function() {
        // Use whenReady instead of setTimeout
        function initMapbox() {
            // Find the Leaflet map object
            var mapElement = document.querySelector('.leaflet-container');
            if (!mapElement || !mapElement._leaflet_id) {
                setTimeout(initMapbox, 100);
                return;
            }

            var map = mapElement._leaflet_map || window[Object.keys(window).find(key => key.startsWith('map_'))];
            if (!map) {
                setTimeout(initMapbox, 100);
                return;
            }

            // Use map.whenReady to ensure proper initialization
            map.whenReady(function() {
                // Create Mapbox tile layers
                var mapboxStreets = L.tileLayer('https://api.mapbox.com/styles/v1/mapbox/streets-v12/tiles/{z}/{x}/{y}?access_token=pk.eyJ1IjoiZ2xhZHdlbGxtIiwiYSI6ImNsMDMyc3c3dDA4MDUzZGhwM3B5eWJjd3RjIn0.qu_A5kxumH4V_A0V7omqkQ', {
                    attribution: '© <a href="https://www.mapbox.com/">Mapbox</a>',
                    tileSize: 512,
                    zoomOffset: -1,
                    maxZoom: 22,
                    maxNativeZoom: 22
                });

                var mapboxSatellite = L.tileLayer('https://api.mapbox.com/styles/v1/mapbox/satellite-v9/tiles/{z}/{x}/{y}?access_token=pk.eyJ1IjoiZ2xhZHdlbGxtIiwiYSI6ImNsMDMyc3c3dDA4MDUzZGhwM3B5eWJjd3RjIn0.qu_A5kxumH4V_A0V7omqkQ', {
                    attribution: '© <a href="https://www.mapbox.com/">Mapbox</a>',
                    tileSize: 512,
                    zoomOffset: -1,
                    maxZoom: 22,
                    maxNativeZoom: 19
                });

                var mapboxHybrid = L.tileLayer('https://api.mapbox.com/styles/v1/mapbox/satellite-streets-v12/tiles/{z}/{x}/{y}?access_token=pk.eyJ1IjoiZ2xhZHdlbGxtIiwiYSI6ImNsMDMyc3c3dDA4MDUzZGhwM3B5eWJjd3RjIn0.qu_A5kxumH4V_A0V7omqkQ', {
                    attribution: '© <a href="https://www.mapbox.com/">Mapbox</a>',
                    tileSize: 512,
                    zoomOffset: -1,
                    maxZoom: 22,
                    maxNativeZoom: 19
                });

                // Store for later use
                window._mapboxLayers = {
                    streets: mapboxStreets,
                    satellite: mapboxSatellite,
                    hybrid: mapboxHybrid
                };

                // Remove existing OSM layer and replace with Mapbox Streets
                map.eachLayer(function(layer) {
                    if (layer instanceof L.TileLayer &&
                        (layer._url.includes('openstreetmap') ||
                         layer._url.includes('tile.osm'))) {
                        map.removeLayer(layer);
                    }
                });

                // Add Mapbox Streets as the base layer (replaces OSM)
                mapboxStreets.addTo(map);

                // Find the existing layer control using Leaflet's internal reference
                var layerControl = null;
                map.eachControl(function(control) {
                    if (control instanceof L.Control.Layers) {
                        layerControl = control;
                    }
                });

                // If layer control exists, add Mapbox layers properly
                if (layerControl) {
                    layerControl.addBaseLayer(mapboxStreets, "Mapbox Streets");
                    layerControl.addBaseLayer(mapboxSatellite, "Mapbox Satellite");
                    layerControl.addBaseLayer(mapboxHybrid, "Mapbox Hybrid");
                }

                console.log('[Mapbox] Integration complete - OSM replaced with Mapbox Streets');
            });
        }

        initMapbox();
    });
    </script>

    // Fix GPS: Enable high accuracy and fix accuracy display
    document.addEventListener('DOMContentLoaded', () => {
      function patchLocateControl() {
        var mapElement = document.querySelector('.leaflet-container');
        if (!mapElement || !mapElement._leaflet_id) {
          setTimeout(patchLocateControl, 100);
          return;
        }

        var map = mapElement._leaflet_map || window[Object.keys(window).find(key => key.startsWith('map_'))];
        if (!map) {
          setTimeout(patchLocateControl, 100);
          return;
        }

        map.whenReady(function() {
          // Find and patch the Locate control
          var locateControl = null;
          map.eachControl(function(control) {
            if (control._container && control._container.classList.contains('leaflet-control-locate')) {
              locateControl = control;
            }
          });

          if (locateControl && locateControl.options && locateControl.options.locateOptions) {
            // Enable high accuracy GPS
            locateControl.options.locateOptions.enableHighAccuracy = true;
            console.log('[GPS] High accuracy enabled');

            // Store reference for accuracy display fix
            window._locateControlRef = locateControl;

            // Patch locationfound handler to show TRUE accuracy (not halved)
            var originalOnLocationFound = locateControl._onLocationFound;
            if (originalOnLocationFound) {
              locateControl._onLocationFound = function(e) {
                // Store original accuracy before it gets manipulated
                var trueAccuracy = e.accuracy;

                // Call original handler
                originalOnLocationFound.call(this, e);

                // Fix the accuracy circle to use TRUE radius (not halved)
                if (this._circle) {
                  this._circle.setRadius(trueAccuracy);
                }

                console.log('[GPS] Lat:', e.latlng.lat.toFixed(6),
                           'Lng:', e.latlng.lng.toFixed(6),
                           'True Accuracy:', trueAccuracy.toFixed(1) + 'm');
              };
            }
          }
        });
      }

      patchLocateControl();
    });
    </script>
